from random import randint
from Crypto.Util.number import getPrime, isPrime
from hashlib import md5
from os import urandom
from sage.all import RealField

H = lambda x:md5(str(x).encode()).hexdigest()
R = RealField(8192)

flag = open("flag.txt","rb").read()
while len(flag) < 2048 // 8:
    flag = urandom(1) + flag + urandom(1)
flag = int.from_bytes(flag, "big")

f0, f1 = flag // 2**1024, flag % 2**1024
hf0, hf1 = H(f0), H(f1)

while not isPrime(f0):
    f0 += 1
while not isPrime(f1):
    f1 += 1

z = getPrime(2048)
x = f0 * z + randint(1, 2**64)
y = f1 * z + randint(1, 2**64)
out = R(x) / R(y)
print(f'{out = }')
print(f'{hf0 = }')
print(f'{hf1 = }')

